contracts/AccessControl.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./UserRegister.sol";
import "./FileRegister.sol";
import "./AuditLogControl.sol";
import "./Helper.sol";

contract AccessControl {

    struct User_Has_File {
        address userAccount;       // User account
        string ipfsCID;            // ipfsCID 
        string encSymmetricKey;    // Key used for the file encryption
        string[] permissions;      // It can be: delete, update, share
        string state;              // active and deactive
    }

    User_Has_File[] private user_Has_File;  // Not using map because solity doesn't accept structs in keys and a map of this would only make sense if userAccound and ipfsCID could simultaneously be considered keys
    FileRegister fileRegister;
    UserRegister userRegister;
    AuditLogControl auditLogControl;
    Helper helper;
    event FileActionLog(address indexed userAccount, string fileIpfsCID, string permissionsOwner, string action);

    constructor(address fileRegisterContract, address userRegisterContract, address helperContract) {
        fileRegister = FileRegister(fileRegisterContract);
        userRegister = UserRegister(userRegisterContract);
        helper = Helper(helperContract);
        auditLogControl = new AuditLogControl();
    }

    // File Upload: only if the transaction executer is the same as the userAccount, 
    //              the transaction executer is the file owner
    //              the transaction executer is not already associate with the file 
    //              the file and the user exist
    //              fields are valid
    function uploadFile (address userAccount, string memory fileIpfsCID, string memory encSymmetricKey) public {  
        if (elegibleToUpload(userAccount, fileIpfsCID)) {
            string[] memory permissionsOwner = new string[](3); // because the file owner has all permissions
            permissionsOwner[0] = "share";
            permissionsOwner[1] = "download";
            permissionsOwner[2] = "delete";
            bool validFields = helper.verifyValidFields(userAccount, fileIpfsCID, encSymmetricKey, permissionsOwner); // Validates if the file and the user exist
            if (validFields){
                User_Has_File memory userFileData = User_Has_File({
                    userAccount: userAccount,
                    ipfsCID: fileIpfsCID,
                    encSymmetricKey: encSymmetricKey,
                    permissions: permissionsOwner,
                    state: "active"
                });
                user_Has_File.push(userFileData);
                auditLogControl.recordLogFromAccessControl(msg.sender, fileIpfsCID, userAccount, helper.stringArrayToString(permissionsOwner), "upload");
            }
        }
    }  

    // File Share: only if the userAccount!=msg.sender (a user cannot change its own permissions), 
    //             userAccount is not the file owner (file owners' permissions cannot change)
    //             msg.sender has "share" permissions over the file
    //             userAccount is not already associated with the file
    //             file exists with "active" state
    //             user exists
    function shareFile (address userAccount, string memory fileIpfsCID, string memory encSymmetricKey, string[] memory permissions) public {
        if (elegibleToShare(userAccount, fileIpfsCID)) {
            bool validFields = helper.verifyValidFields(userAccount, fileIpfsCID, encSymmetricKey, permissions);
            if (validFields) {
                User_Has_File memory userFileData = User_Has_File({
                    userAccount: userAccount,
                    ipfsCID: fileIpfsCID,
                    encSymmetricKey: encSymmetricKey,
                    permissions: permissions,
                    state: "active"
                });
                user_Has_File.push(userFileData);
                auditLogControl.recordLogFromAccessControl(msg.sender, fileIpfsCID, userAccount, helper.stringArrayToString(permissions), "share");
            }
        }
    } 

    // Updates the permissions a user has over a file if: 
    //              executer has to be different from the user account - userAccount should not be able to give permissions to himself
    //              userAccound cannot be the file owner account: the file owner permissions cannot change - should always be all permissions
    //              the transaction executer has to have share permissions over the file
    //              the file is in the active state
    function updateUserFilePermissions(address userAccount, string memory fileIpfsCID, string[] memory permissions) public {
        if (elegibleToUpdPermissions(userAccount, fileIpfsCID)) {
            for (uint256 i=0; i<user_Has_File.length; i++) {
                if (isKeyEqual(userAccount, user_Has_File[i].userAccount, fileIpfsCID, user_Has_File[i].ipfsCID)) {
                    user_Has_File[i].permissions = permissions;
                    auditLogControl.recordLogFromAccessControl(msg.sender, fileIpfsCID, userAccount, helper.stringArrayToString(permissions), "update permissions");
                    return;
                }
            }
        }
    }

    // Downloads the file, if: the transaction executer is the same as the user
    //                         the user has download permissions over the file
    //                         the file is active
    function downloadFileAudit(string memory fileIpfsCid, address userAccount) public {
        if (msg.sender == userAccount &&
            userHasPermissionOverFile(userAccount, fileIpfsCid, "download") &&
            keccak256(abi.encodePacked(getFileState(fileIpfsCid).resultString)) == keccak256(abi.encodePacked("active"))
        ) {
            // No precessing is done (as it happens with updateUserFilePermissions or shareFile or updateFile)
            auditLogControl.recordLogFromAccessControl(msg.sender, fileIpfsCid, userAccount, "-", "download");
        }
    }

    // Deletes a file if: the transaction executer as "Delete" permissions over the file
    //                    the file exists
    function deactivateFileUserAssociation(address userAccount, string memory fileIpfsCid) public {
        if(userHasPermissionOverFile(msg.sender, fileIpfsCid, "delete") && 
           fileRegister.fileExists(fileIpfsCid)
        ) {
            // Delete all associations that are in the "active" state
            for (uint256 i=0; i<user_Has_File.length; i++) {
                if (keccak256(abi.encodePacked(user_Has_File[i].ipfsCID)) == keccak256(abi.encodePacked(fileIpfsCid)) &&
                    keccak256(abi.encodePacked(user_Has_File[i].state)) == keccak256(abi.encodePacked("active"))
                ) {
                    user_Has_File[i].state = "deactive";  // updates the state
                }
            }

            // Audit Log
            auditLogControl.recordLogFromAccessControl(msg.sender, fileIpfsCid, userAccount, "-", "deleted");
        }
    }

    // Returns the encrypted symmetric key of a given user and file
    // The user can only get the symmetric key if: he is associated with the file 
    //                                             the transaction executer is the same as the account user
    //                                             the file is in the active state
    function getEncSymmetricKeyFileUser (address accountUser, string memory fileIpfsCID) public view returns (Helper.ResultString memory) {
        if ((msg.sender == accountUser) && 
             userAssociatedWithFile(accountUser, fileIpfsCID) &&
             keccak256(abi.encodePacked(getFileState(fileIpfsCID).resultString)) == keccak256(abi.encodePacked("active"))) {
            for (uint256 i=0; i<user_Has_File.length; i++) {
                if (isKeyEqual(accountUser, user_Has_File[i].userAccount, fileIpfsCID, user_Has_File[i].ipfsCID)) {
                    return Helper.ResultString(true, user_Has_File[i].encSymmetricKey);
                }
            }
        } 
        return Helper.ResultString(false, "");
    }

    // Returns the permissions of a given user over a given file if: mesg.sender is associated with the file
    //                                                               the file is in the active state
    function getPermissionsOverFile (address userAccount, string memory fileIpfsCID) public view returns (Helper.ResultStringArray memory) {
        if (messageSenderAssociatedToFile(fileIpfsCID) &&
            keccak256(abi.encodePacked(getFileState(fileIpfsCID).resultString)) == keccak256(abi.encodePacked("active"))
        ) { // msg.sender has to be associated with the file
            for (uint256 i=0; i<user_Has_File.length; i++) {
                if (isKeyEqual(userAccount, user_Has_File[i].userAccount, fileIpfsCID, user_Has_File[i].ipfsCID)) {
                    return Helper.ResultStringArray(true, user_Has_File[i].permissions);
                }
            }
        }
        return Helper.ResultStringArray(false, new string[](0));
    }

    // Returns the files of a giving user in a certain state
    function getUserFiles(address account, string memory state) public view returns (FileRegister.ResultFiles memory) {
        if (msg.sender == account) { // Users cannot not see files of other users
            FileRegister.File[] memory userFilesResult = new FileRegister.File[](user_Has_File.length); // Stores the users' files
            uint resultIndex = 0;
            for (uint i=0; i<user_Has_File.length; i++) {
                if (user_Has_File[i].userAccount == account &&
                    (keccak256(abi.encodePacked(state)) == keccak256(abi.encodePacked(user_Has_File[i].state)) || keccak256(abi.encodePacked(state)) == keccak256(abi.encodePacked("")))) {
                    string memory fileIpfsCIDUser = user_Has_File[i].ipfsCID;
                    FileRegister.ResultFile memory result = fileRegister.getFileByIpfsCID(fileIpfsCIDUser); // Gets the file having the IPFS CID
                    FileRegister.File memory fileUser = result.file;
                    // Stores the file in the array to be returned
                    userFilesResult[resultIndex] = fileUser;
                    resultIndex++;
                }
            }
            // Resize the result array to remove unused elements
            assembly {
                mstore(userFilesResult, resultIndex)
            }
            // Returns accordingly
            if (resultIndex != 0) {
                return FileRegister.ResultFiles(true, userFilesResult);
            } 
        }
        return FileRegister.ResultFiles(false, new FileRegister.File[](0));
    }

    // Returns if a user has a certain permission over a file if the file is in the active state
    function userHasPermissionOverFile(address userAccount, string memory fileIpfsCID, string memory permission) public view returns (bool) {
        if (keccak256(abi.encodePacked(getFileState(fileIpfsCID).resultString)) == keccak256(abi.encodePacked("active"))) {
            string[] memory userPermissions = getPermissionsOverFile(userAccount, fileIpfsCID).resultStrings;
            for (uint256 i=0; i<userPermissions.length; i++) {
                if (keccak256(abi.encodePacked(userPermissions[i])) == keccak256(abi.encodePacked(permission))) {
                    return true; // Return true if permission is found
                }
            }
        }
        return false;
    }

    // Sees if a user is already associated with a file if: the message sender is associated with the file
    //                                                      or the message sender is the auditLogControl
    function userAssociatedWithFile(address userAccount, string memory fileIpfsCID) public view returns (bool) {
        if (messageSenderAssociatedToFile(fileIpfsCID) ||
            msg.sender == address(auditLogControl) // AuditLogControl also calls this method for the validation of one of his methods
        ) {
            for (uint256 i=0; i<user_Has_File.length; i++) {
                if (isKeyEqual(userAccount, user_Has_File[i].userAccount, fileIpfsCID, user_Has_File[i].ipfsCID)) {
                    return true;
                }
            }
        }
        return false;
    }

    // Sees if the message sender is associated with a certain file
    function messageSenderAssociatedToFile(string memory fileIpfsCID) public view returns (bool) {
        for (uint256 i=0; i<user_Has_File.length; i++) {
            if (isKeyEqual(msg.sender, user_Has_File[i].userAccount, fileIpfsCID, user_Has_File[i].ipfsCID)) {
                return true;
            }
        }
        return false;
    }

    // Verifies if the user is elegible to share the file
    function elegibleToShare(address userAccount, string memory fileIpfsCID) public view returns (bool) {
        if (msg.sender != userAccount && // msg.sender can't be the same as the userAccount because the user should not be able to give permissions to himself
            !fileRegister.userIsFileOwner(userAccount, fileIpfsCID) && // the userAccount cannot be the file owner account: the owner permissions cannot change they are always: share, delete, upload
            userHasPermissionOverFile(msg.sender, fileIpfsCID, "share") && // The transaction executer can only share a file if he has share permissions 
            !userAssociatedWithFile(userAccount, fileIpfsCID) && // The user cannot be already be associated with the file, in order to not have duplicated records
            fileRegister.fileExists(fileIpfsCID) &&        // verifies if the file exist
            keccak256(abi.encodePacked(getFileState(fileIpfsCID).resultString)) == keccak256(abi.encodePacked("active")) &&
            userRegister.existingAddress(userAccount)   // verifies if the user exist
        ) {
            return true;
        }
        return false;
    }

    // Retruns if a user is elegible to update permissions of a user over a file
    function elegibleToUpdPermissions(address userAccount, string memory fileIpfsCID) public view returns (bool) {
        if (msg.sender != userAccount && // msg.sender can't be the same as the userAccount because the user should not be able to give permissions to himself
            !fileRegister.userIsFileOwner(userAccount, fileIpfsCID) && // the userAccount cannot be the file owner account: the owner permissions cannot change they are always: share, delete, upload
            userHasPermissionOverFile(msg.sender, fileIpfsCID, "share") && // The transaction executer can only share a file if he has share permissions 
            keccak256(abi.encodePacked(getFileState(fileIpfsCID).resultString)) == keccak256(abi.encodePacked("active"))
        ) {
            return true;
        }
        return false;
    }
    
    // Verifies if the transaction executer is elegible to upload the file
    function elegibleToUpload (address userAccount, string memory fileIpfsCID) public view returns (bool) {
        if (msg.sender == userAccount && // if different it means the transaction is executer is trying to upload a file in the name of another user
            !userAssociatedWithFile(userAccount, fileIpfsCID) &&// if already associated then it should be called the share file()
            fileRegister.userIsFileOwner(userAccount, fileIpfsCID) && // who uploads the file has to be the file owner
            fileRegister.fileExists(fileIpfsCID) &&        // verifies if the file exist
            userRegister.existingAddress(userAccount)   // verifies if the user exist
            ) {
            return true;
        }
        return false;
    }

    // Sees if the ipfsCID and the account (primary keys) are the same as the inputs 
    function isKeyEqual(address accountInput, address accountList, string memory ipfsCIDInput, string memory ipfsCIDList) public pure returns (bool){
        return (accountList == accountInput) && (keccak256(abi.encodePacked(ipfsCIDList)) == keccak256(abi.encodePacked(ipfsCIDInput)));
    }

    // Getter function for auditLogControl address
    function getAuditLogControlAddress() public view returns (address) {
        return address(auditLogControl);
    }

    // Get the file state if: the transaction executer is associated with the file
    function getFileState(string memory fileIpfsCid) public view returns (Helper.ResultString memory) {
        if (messageSenderAssociatedToFile(fileIpfsCid)) {
            for (uint i=0; i<user_Has_File.length; i++) {
                if (keccak256(abi.encodePacked(user_Has_File[i].ipfsCID)) == keccak256(abi.encodePacked(fileIpfsCid))) {
                    return Helper.ResultString(true, user_Has_File[i].state);
                }
            }
        }
        return Helper.ResultString(false, "");
    }
}

contracts/AuditLogControl.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./AccessControl.sol";

contract AuditLogControl {

    struct ResultAuditLogs {
        bool success;
        AuditLog[] logs;
    }
    
    struct AuditLog {
        string fileIpfsCid;          // foreign key
        address userAccount;         // foreign key
        uint256 timestamp;           // primary key
        string action;
        string permissions;
        address executer;            // stores who performed the log registration => avoids people writing: "User A uploaded file B" when it wasn't user A
    }

    AuditLog[] private logs;  // Not using map because solity doesn't accept structs in keys and a map of this would only make sense if userAccound, ipfsCID, and timestamp could simultaneously be considered keys

    AccessControl accessControl;
    address accessControlContractAddress;

    constructor() {
        accessControl = AccessControl(msg.sender);
        accessControlContractAddress = msg.sender;
    }

    // Records executions performed by the AccessControl.sol contract. Be it: upload, share, delete, or update permissions
    function recordLogFromAccessControl(address executer, string memory fileIpfsCid, address userAccount, string memory permissions, string memory action) public {
        if (msg.sender == accessControlContractAddress) {
            AuditLog memory auditLog = AuditLog({
                fileIpfsCid: fileIpfsCid,
                userAccount: userAccount,
                timestamp: block.timestamp,
                action: action,
                permissions: permissions,
                executer: executer
            });
            logs.push(auditLog);
        }
    }

    // Returns the logs of a given set of files only if: transaction executer is associated with the file         
    function getLogs(string[] memory filesIpfsCid) public view returns (ResultAuditLogs memory){ 
        AuditLog[] memory auditLogFile = new AuditLog[](logs.length); // Stores the logs of the files
        uint resultIndex = 0;
        for (uint256 i = 0; i < filesIpfsCid.length; i++) {
            if (accessControl.userAssociatedWithFile(msg.sender, filesIpfsCid[i])) {
                for (uint j=0; j<logs.length; j++) {
                    if (keccak256(abi.encodePacked(logs[j].fileIpfsCid)) == keccak256(abi.encodePacked(filesIpfsCid[i]))) {
                        auditLogFile[resultIndex] = logs[j];
                        resultIndex++;
                    }
                }
            }
        }

        // Resize the result array to remove unused elements
        assembly {
            mstore(auditLogFile, resultIndex)
        }
        // Returns accordingly
        if (resultIndex != 0) {
            return ResultAuditLogs(true, auditLogFile);
        }
        return ResultAuditLogs(false, new AuditLog[](0));
    }

}

contracts/FileRegister.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./Helper.sol";

contract FileRegister {

    struct File {
        string ipfsCID;            // CID from IPFS (hash) - Unique
        string fileName;           // File Name - cannot be repeated
        address owner;             // The owner - who uploaded the file
        string fileType;           // Image or file
        string iv;                 // Initialization Vector for AES (used in file encryption and decryption with symmetric key)
    }
    struct ResultFile {
        bool success;
        FileRegister.File file;
    }
    struct ResultFiles {
        bool success;
        FileRegister.File[] files;
    }

    mapping(string => File) private files;  // Key: ipfsCID
    Helper helper;

    constructor(address helperContract) {
        helper = Helper(helperContract);
    }

    // Create a file (Upload)
    // Should add file if: the owner is the same as the transaction executer 
    //                     the file exists
    //                     file parameter inputs are valid
    function addFile(File memory file) public {
        if (file.owner == msg.sender) { // Only if the one executing the transaction is the file owner
            if (canAddFile(file)) {
                files[file.ipfsCID] = file;
            }
        }
    }

    // Gets a file having the files' IPFS CID
    // No restrictions to execute this function: the content is encrypted
    // It was planned to validate if the user is the owner or if the file was shared with the user, nevertheless this would originate a dependency with the AccessControl which is already dependent with the FileRegister
    function getFileByIpfsCID(string memory fileIpfsCid) public view returns (ResultFile memory) {
        if (bytes(files[fileIpfsCid].fileName).length > 0) {
            return ResultFile(true, files[fileIpfsCid]);       
        } else {
            return ResultFile(false, File("", "", address(0), "", ""));       
        }
    }

    // Verifies if a file can be added
    function canAddFile(File memory file) public view returns (bool) {
        if (file.owner == msg.sender) {
            if (!fileExists(file.ipfsCID) && helper.fileParamValid(file)) { // stores only if the file is not already soted => avoid overlay of information
                return true;
            }
        }
        return false;
    }

    // Verifies if a file is already stored
    // Because no infromarion in particular is disclosed and because it only returns true or false, no validation in the access was made (the one calling this method doesn't need to be the same one of the input)
    // This method is also used by the AccessControl.sol
    function fileExists(string memory fileIpfsCID) public view returns (bool) {
        if (bytes(files[fileIpfsCID].ipfsCID).length != 0) {
            return true;
        }
        return false;
    }

    // Returns if the user is the file owner
    // Because no infromarion in particular is disclosed and because it only returns true or false, no validation in the access was made (the one calling this method doesn't need to be the same one of the input)
    // This method is also used by the AccessControl.sol 
    function userIsFileOwner(address userAccount, string memory fileIpfsCID) public view returns (bool) {
        if (files[fileIpfsCID].owner == userAccount) {
            return true;
        }
        return false;
    }
}

contracts/Helper.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./UserRegister.sol";
import "./FileRegister.sol";
import "./AuditLogControl.sol";

contract Helper {
    
    struct ResultAddress {
        bool success;
        address resultAddress;
    }
    struct ResultString {
        bool success;
        string resultString;
    }
    struct ResultStringArray {
        bool success;
        string[] resultStrings;
    }

    // Verifies if the fields are valid 
    // The one seeing if the user has the right fields should be the same one executing the transaction
    function validUserFields(UserRegister.User memory user) public pure returns (bool) {
        if (user.account != address(0) && bytes(user.userName).length != 0 && bytes(user.publicKey).length != 0 && bytes(user.privateKey).length != 0) {
            return true;
        }
        return false;
    }

    // Verifies if the file has all parameters valid
    function fileParamValid(FileRegister.File memory file) public pure returns (bool) {
        if (bytes(file.ipfsCID).length != 0 && 
            bytes(file.fileName).length != 0 && 
            bytes(file.fileType).length != 0 && 
            bytes(file.iv).length != 0 && 
            file.owner != address(0)) {
            return true;
        }
        return false;
    } 

    // Verify if the fields of userFileData are valid
    function verifyValidFields (address userAccount, string memory fileIpfsCID, string memory encSymmetricKey, string[] memory permissions) public pure returns (bool) {
        if (userAccount != address(0) &&
            bytes(fileIpfsCID).length != 0 && 
            bytes(encSymmetricKey).length != 0 && 
            permissions.length != 0 ) {
            return true;
        }
        return false;
    }

    // Converts a string array into a string
    function stringArrayToString(string[] memory permissions) public pure returns (string memory) {
        string memory permissionsString;
        for (uint i = 0; i<permissions.length; i++) {
            permissionsString = string(abi.encodePacked(permissionsString, permissions[i]));
            if (i < permissions.length -1) {
                permissionsString = string(abi.encodePacked(permissionsString, ", "));
            }
        }
        return permissionsString;
    }

}

contracts/UserRegister.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./Helper.sol";

contract UserRegister {
    
    struct User {
        address account;           // Address Account in MetaMask - Unique
        string userName;           // Name of the user - unique
        string publicKey;          // User's public key
        string privateKey;         // User's private key
    }

    struct ResultUser {
        bool success;
        User user;
    }

    mapping(address => User) private users;                  // Key: account 
    mapping(string => User) private usersByName;             // Same information as the map "users" but with the name being the key: helps in the method: getUserByUserName 
    mapping(string => bool) private userNameExists;
    Helper helper;

    constructor(address helperContract) {
        helper = Helper(helperContract);
    }

    // Create a new user by adding him to the blockchain
    // Unwanted Usage: incert an existing user and overlap the existing information. 
    // To be able to register: userName has to be unique
    //                         address has to be unique
    //                         the transaction executer has to have the same address as the user
    //                         user fields have to be valid
    function userRegistered(User memory user) public {
        if (user.account == msg.sender) {
            if (canRegister(user)) { // Checks if the user is elegible to register (including validating fields)
                users[user.account] = User(user.account, user.userName, user.publicKey, user.privateKey);
                usersByName[user.userName] = User(user.account, user.userName, user.publicKey, user.privateKey);
                userNameExists[user.userName] = true;
            } 
        }
    }

    // Gets the information of a given user. If the user doesn't exist it returns an empty user.
    // The one asking for the users' information should be the same one executing the transaction
    function getUser(address account) public view returns (ResultUser memory) {
        if (account == msg.sender) {
            if (users[account].account != address(0)) {
                return ResultUser(true, users[account]);
            } 
        }
        return ResultUser(false, User(address(0), "", "", ""));
    }

    // Returns the user nome of a user
    function getUserUserName(address account) public view returns (Helper.ResultString memory) {
        if (users[account].account != address(0)) {
            return Helper.ResultString(true, users[account].userName);
        }
        return Helper.ResultString(false, "");
    } 

    // Given a name, returns the user account, if the user exists
    function getUserAccount(string memory userName) public view returns (Helper.ResultAddress memory) {
        if (bytes(usersByName[userName].userName).length > 0) {
            return Helper.ResultAddress(true, usersByName[userName].account);       
        } else {
            return Helper.ResultAddress(false, address(0));       
        }
    }

    // Given the account, returns the users' public key
    function getPublicKey(address account) public view returns (Helper.ResultString memory) {
        if (users[account].account != address(0)) {
            return Helper.ResultString(true, users[account].publicKey);
        } else {
            return Helper.ResultString(false, "");
        }
    }

    // Checks if the user is elegible to register
    // The one seeing if the user is elegible to register should be the same one executing the transaction
    function canRegister(User memory user) public view returns (bool) {
        if (user.account == msg.sender) { 
            if (!existingAddress(user.account) && !existingUserName(user.userName) && helper.validUserFields(user)) {
                return true;
            }
        }
        return false;        
    }

    // Verifies if the address exists (if the user already exists)
    // Because no infromarion in particular is disclosed and because it only returns true or false, no validation in the access was made (the one calling this method doesn't need to be the same one of the input)
    // This method is also used by the AccessControl.sol 
    function existingAddress(address account) public view returns (bool) {
        if (users[account].account != address(0)) {
